function RecommentationCard({track}) {
  return (
    <div className="card swipeable-cards m-auto text-light position-relative">
      <img
        className="card-img-top"
        src={track.album.images[1].url}
        alt="Card image cap"
      />
      <div className="card-body">
        <h3 className="card-title">{track.name}</h3>
        <h5>{track.artists[0].name}</h5>
        <p className="card-text my-3">
          <i className="bi bi-vinyl-fill"></i> {track.album.name}
        </p>
      </div>
    </div>
  );
}

export default RecommentationCard;
